Lietuvos ledo ritulio rinktinė  gavo patikinimą iš Latvijos „Dinamo“ klubo, kad šalies rinktinei uostamiestyje pirmą kartą rengiamame tokio lygio ledo ritulio turnyre galės atstovauti abu Kontinentinės ledo ritulio lygos (KHL) Rygos „Dinamo“ klubo lietuviai, 25-erių vartininkas  Mantas Armalis  ir 26-erių gynėjas  Nerijus Ališauskas . Abu žaidėjai tikino, jog Klaipėdoje kartu su rinktine kausis tik dėl pirmos vietos turnyre. „Senokai žaidžiau Lietuvoje ir Lietuvos rinktinėje, tad su nekantrumu laukiu turnyro. Tikiuosi sirgalių palaikymo ir rimtos kovos su visais varžovais“, – hockey.lt sakė N. Ališauskas. „Manau, mes galime kautis dėl pirmos vietos ir dėsime visas pastangas visuose trijuose mačuose. Tikiuosi, jog Klaipėdoje bus geros kovos, o sirgaliai mėgausis aukšto lygio ledo rituliu“, – sakė M. Armalis. (function(d, s, i, r) {
