 žaidžiantys ledo ritulininkai. Po pirmojo etapo Estijoje „CROWNS Baltijos iššūkio taurėje“ pirmauja Latvija, antri estai, treti lietuviai. Trijų Baltijos šalių ledo ritulio federacijos prieš metus sutarė kartu rengti trijų etapų ledo ritulio turnyrą, kuris vyktų visose trijose valstybėse. „CROWNS Baltijos iššūkio taurės“ nugalėtojas bus paskelbtas kitų metų vasarį Latvijoje. Ketvirtoji, organizatorių nuožiūra pakviesta komanda varžosi dėl etapo taurės ir apdovanojimų, tačiau galutinėje įskaitoje ketvirtosios komandos rezultatai neskaičiuojami. Turnyro tvarkaraštis: Lapkričio 10 diena (penktadienis) 16.30 Ukraina- Latvija 20.00 Lietuva – Estija Lapkričio 11 diena (šeštadienis) 13.00 Estija – Ukraina 16.30 Lietuva – Latvija Lapkričio 12 diena (sekmadienis) 13.00 Latvija – Estija 16.30 Ukraina – Lietuva. Nugalėtojų apdovanojimas.
